use crate::bitfield::Bitfield;

struct Dict {
  exact_match: [[Bitfield; 26]; 5],
  inexact_match: [[Bitfield; 26]; 5],
}

pub fn green(letter: char, pos: usize) -> &'static Bitfield {
  debug_assert!(pos < 5);
  debug_assert!(letter >= 'a');
  debug_assert!(letter <= 'z');
  &DICT.exact_match[pos][letter_idx(letter)]
}

pub fn yellow(letter: char, existing_occurrences: usize) -> &'static Bitfield {
  debug_assert!(existing_occurrences < 5);
  debug_assert!(letter >= 'a');
  debug_assert!(letter <= 'z');
  &DICT.inexact_match[existing_occurrences][letter_idx(letter)]
}

pub fn letter_idx(letter: char) -> usize {
  letter as usize - 'a' as usize
}

